import React, { useState, useEffect } from "react";
import Dexie from "dexie";

// ✅ Initialize IndexedDB using Dexie
const db = new Dexie("TalentFlowDB");
db.version(1).stores({
  assessments: "++id, title, questions",
});

// ⚙️ Simulated latency & error rate
const simulateNetwork = async () => {
  const delay = Math.random() * (1200 - 200) + 200;
  await new Promise((res) => setTimeout(res, delay));
  if (Math.random() < 0.1) throw new Error("Network error! Try again.");
};

// ✅ Assessment Builder Component
export default function Builder() {
  const [assessments, setAssessments] = useState([]);
  const [title, setTitle] = useState("");
  const [question, setQuestion] = useState("");
  const [questions, setQuestions] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // 🧩 Load saved assessments
  useEffect(() => {
    const load = async () => {
      const data = await db.assessments.toArray();
      setAssessments(data);
    };
    load();
  }, []);

  // ➕ Add Question
  const addQuestion = () => {
    if (question.trim()) {
      setQuestions([...questions, question]);
      setQuestion("");
    }
  };

  // 💾 Save Assessment
  const saveAssessment = async () => {
    if (!title || questions.length < 10) {
      alert("Please add a title and at least 10 questions.");
      return;
    }

    try {
      setLoading(true);
      setError("");
      await simulateNetwork();
      const id = await db.assessments.add({ title, questions });
      setAssessments([...assessments, { id, title, questions }]);
      setTitle("");
      setQuestions([]);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ padding: "1rem" }}>
      <h2>📋 Assessment Builder</h2>

      <div style={{ marginBottom: "1rem" }}>
        <input
          type="text"
          placeholder="Assessment Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          style={{ padding: "8px", width: "60%", marginRight: "10px" }}
        />
        <button onClick={saveAssessment} disabled={loading}>
          {loading ? "Saving..." : "Save Assessment"}
        </button>
      </div>

      <div style={{ marginBottom: "1rem" }}>
        <input
          type="text"
          placeholder="Enter question"
          value={question}
          onChange={(e) => setQuestion(e.target.value)}
          style={{ padding: "8px", width: "60%", marginRight: "10px" }}
        />
        <button onClick={addQuestion}>Add Question</button>
      </div>

      {error && <p style={{ color: "red" }}>⚠️ {error}</p>}

      <h4>Questions Added: {questions.length}</h4>
      <ul>
        {questions.map((q, i) => (
          <li key={i}>{q}</li>
        ))}
      </ul>

      <hr />

      <h3>🧠 Saved Assessments</h3>
      {assessments.length === 0 ? (
        <p>No assessments saved yet.</p>
      ) : (
        assessments.map((a) => (
          <div
            key={a.id}
            style={{
              border: "1px solid #ddd",
              borderRadius: "8px",
              padding: "10px",
              marginBottom: "10px",
            }}
          >
            <h4>{a.title}</h4>
            <ul>
              {a.questions.slice(0, 5).map((q, i) => (
                <li key={i}>{q}</li>
              ))}
            </ul>
            <small>({a.questions.length} total questions)</small>
          </div>
        ))
      )}
    </div>
  );
}
